        </div>
        <div class="col-lg-5 col-md-6">
          <div class="card login-page bg-white shadow rounded border-0">
            <div class="card-body">
              <h4 class="card-title text-center">Login</h4>
              <form class="login-form mt-4" [formGroup]="loginForm">
                <div class="row">
                  <div class="col-lg-12 mb-4">
                    <div class="form-group position-relative" style="margin-bottom: 0px;">
                      <label>Email address <span class="text-danger">*</span></label>
                      <i-feather name="user" class="fea icon-sm icons"></i-feather>
                      <input type="email" class="form-control pl-5 formField" placeholder="Your email" formControlName="email">
                    </div>
                    <div *ngIf="(loginForm.invalid && loginForm.get('email')?.dirty) || (loginForm.get('email')?.touched || submitted)" >
                      <small *ngIf="loginForm.get('email')?.hasError('required') &&
                      !loginForm.get('email')?.hasError('email')" class="text-danger">
                        Email is required
                      </small>
                      <small *ngIf="loginForm.get('email')?.hasError('email')" class="text-danger">
                        Invalid email address
                      </small>
                    </div>
                  </div>

                  <div class="col-lg-12 mb-4">
                    <div class="form-group position-relative" style="margin-bottom: 0px;">
                      <label>Password <span class="text-danger">*</span></label>
                      <i-feather name="key" class="fea icon-sm icons"></i-feather>
                      <input type="password" class="form-control pl-5 formField" placeholder="Password" formControlName="password">
                    </div>
                    <div *ngIf="(loginForm.invalid && loginForm.get('password')?.dirty) || (loginForm.get('password')?.touched || submitted)" >
                      <small *ngIf="loginForm.get('password')?.hasError('required')" class="text-danger">
                        Password is required
                      </small>
                    </div>
                  </div>

                  <div class="col-lg-12">
                    <div class="d-flex justify-content-between">
                      <div class="form-group">
                        <div class="custom-control custom-checkbox">
                          <input type="checkbox" class="custom-control-input checky" id="customCheck1">
                          <label class="custom-control-label" for="customCheck1">Remember me</label>
                        </div>
                      </div>
                      <p class="forgot-pass mb-0"><a routerLink="/forgot-password"
                          class="text-primary font-weight-bold">Forgot your password ?</a></p>
                    </div>
                  </div>
                  <div class="col-12 mb-0 pb-0" *ngIf="send">
                    <div class="row justify-content-center">
                      <img src="assets/images/go-africa/loading.gif" class="img-fluid" width="150" height="150" alt="loading">
                    </div>
                  </div>
                  <div class="col-lg-12 mb-0" *ngIf="!send">
                    <button class="btn btn-block btn-primary" (click)="login()">
                      Login
                    </button>

                  </div>
                  <div class="col-12 text-center" *ngIf="!send">
                    <p class="mb-0 mt-3"><small class="text-dark mr-2">Don't have an account ?</small> <a href="javascript:void()"
                        routerLink="/register" class="text-primary font-weight-bold">register</a></p>
                  </div>
                </div>
              </form>
            </div>
          </div>
          <!---->
        </div>
        <!--end col-->
      </div>
      <!--end row-->
    </div>
    <!--end container-->
  </section>
  <!--end section-->
  <!-- Hero End -->
